import React, { useEffect, useState } from 'react';
import API from '../api';

export default function Dashboard({ handleLogout }) {
    const [userData, setUserData] = useState(null);
    const [challenges, setChallenges] = useState([]);
    const [leaderboard, setLeaderboard] = useState([]);
    const [isLoading, setIsLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        const fetchAll = async () => {
            setIsLoading(true);
            try {
                const [userRes, chalRes, lbRes] = await Promise.all([
                    API.get('/api/user'),
                    API.get('/api/challenges'),
                    API.get('/api/leaderboard')    // new endpoint!
                ]);
                setUserData(userRes.data);
                setChallenges(chalRes.data);
                setLeaderboard(lbRes.data);
                setError('');
            } catch (err) {
                setError('Failed to load dashboard data');
            } finally {
                setIsLoading(false);
            }
        };
        fetchAll();
    }, []);

    if (isLoading) return <p>Loading dashboard...</p>;
    if (error) return <p className="error-message">{error}</p>;

    // figure out hard drills progress
    const hard = challenges.filter(c => c.difficulty === 'hard');
    const doneHard = hard.filter(c => c.run_count > 0).length;
    const hardPct = hard.length
        ? Math.round((doneHard / hard.length) * 100)
        : 0;

    return (
        <div className="dashboard-container">
            <h1 className="dashboard-header">
                Welcome, <strong>{userData.username}</strong>
            </h1>

            <div className="dashboard-content">
                {/* XP + Practice + Progress Bar */}
                <div className="dashboard-card" style={{ maxWidth: '600px' }}>
                    <h2>Total XP Earned</h2>
                    <p><strong>{userData.xp}</strong></p>
                    <p>Rank: <strong>{userData.rank}</strong></p>

                    {/* progress toward Black Belt via hard drills */}
                    <h3>Hard Drills Completion</h3>
                    <p>
                        {doneHard} / {hard.length} completed
                    </p>
                    <div className="progress-container">
                        <div
                            className="progress-bar"
                            style={{ width: `${hardPct}%` }}
                        />
                    </div>
                    {hardPct === 100 && (
                        <p className="success-message">
                            🎉 All hard drills done! Black Belt unlocked!
                        </p>
                    )}

                    {/* practice sessions list */}
                    <h3 style={{ marginTop: '1rem' }}>Practice Sessions</h3>
                    {userData.practice_summary.length === 0
                        ? <p>No sessions logged yet.</p>
                        : (
                            <ul style={{ textAlign: 'left' }}>
                                {userData.practice_summary.map(ps => (
                                    <li key={ps.challenge_id}>
                                        {ps.title}: <strong>{ps.runs}</strong> run{ps.runs !== 1 && 's'}
                                    </li>
                                ))}
                            </ul>
                        )}
                </div>

                {/* Leaderboard */}
                <div className="dashboard-card" style={{ maxWidth: '300px' }}>
                    <h2>Leaderboard</h2>
                    <ol style={{ textAlign: 'left' }}>
                        {leaderboard.map((u, i) => (
                            <li key={u.username}>
                                {u.username}: {u.xp} XP
                            </li>
                        ))}
                    </ol>
                </div>
            </div>
        </div>
    );
}
